import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { AuthProvider } from "./context/AuthContext"; // Import AuthProvider
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import StudyGroups from "./components/StudyGroups";
import GroupDetail from "./components/GroupDetail";
import Profile from "./components/Profile";
import Login from "./components/Login";
import Register from "./components/Register";
import CalendarPage from "./components/CalendarPage"; // Import the new CalendarPage
import "react-toastify/dist/ReactToastify.css"; // Import react-toastify CSS

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="flex flex-col min-h-screen bg-gray-50 dark:bg-gray-800">
          <Navbar />
          <main className="container mx-auto px-4 py-8 flex-grow">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/study-groups" element={<StudyGroups />} />
              <Route path="/groups/:groupId" element={<GroupDetail />} />
              <Route path="/profile" element={<Profile />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/calendar" element={<CalendarPage />} />{" "}
              {/* Add Calendar route */}
              <Route path="*" element={<div>404 - Page Not Found</div>} />
            </Routes>
          </main>
          <footer className="bg-gradient-to-r from-blue-600 to-indigo-600 dark:from-gray-800 dark:to-gray-900 text-white dark:text-gray-200 p-6 shadow-lg border-t border-blue-200 dark:border-gray-600">
            <style>
              {`
                @keyframes fadeInUp {
                  0% { opacity: 0; transform: translateY(20px); }
                  100% { opacity: 1; transform: translateY(0); }
                }
                @keyframes glow {
                  0% { box-shadow: 0 0 5px rgba(209, 213, 219, 0.3); } /* gray-300 */
                  50% { box-shadow: 0 0 15px rgba(209, 213, 219, 0.5); }
                  100% { box-shadow: 0 0 5px rgba(209, 213, 219, 0.3); }
                }
                .animate-fade-in-up {
                  animation: fadeInUp 0.5s ease-out forwards;
                }
                .dark-glow {
                  animation: glow 2s infinite ease-in-out;
                }
                .hover-scale {
                  transition: transform 0.3s ease-in-out;
                }
                .hover-scale:hover {
                  transform: scale(1.05);
                }
                .social-icon {
                  transition: all 0.3s ease-in-out;
                }
                .social-icon:hover {
                  transform: scale(1.2);
                  filter: brightness(1.2);
                }
                .dark .social-icon:hover {
                  filter: brightness(1.5);
                }
              `}
            </style>
            <div className="container mx-auto flex flex-col md:flex-row items-center justify-between animate-fade-in-up">
              <p className="bg-clip-text bg-gradient-to-r from-blue-200 to-indigo-200 dark:from-amber-200 dark:to-amber-100">
                © 2025 NexusEd. All rights reserved.
              </p>
              <div className="md:-ml-40">
                <p className="text-sm mt-2 md:mt-0 bg-clip-text text-transparent bg-gradient-to-r from-blue-100 to-indigo-100 dark:from-gray-400 dark:to-gray-300">
                  Powered by NexusEd
                </p>
              </div>
              <div className="flex space-x-4 mt-4 md:mt-0">
                <a
                  href="#"
                  className="social-icon hover:dark-glow"
                  aria-label="Facebook"
                >
                  <svg
                    className="w-6 h-6 fill-current text-blue-300 dark:text-gray-400"
                    viewBox="0 0 24 24"
                  >
                    <path d="M12 2.04c-5.5 0-9.96 4.46-9.96 9.96 0 4.99 3.66 9.12 8.44 9.88v-6.98h-2.54v-2.9h2.54v-2.2c0-2.5 1.5-3.88 3.78-3.88 1.1 0 2.24 0.2 2.24 0.2v2.46h-1.26c-1.24 0-1.62 0.77-1.62 1.56v1.86h2.84l-0.46 2.9h-2.38v6.98c4.78-0.76 8.44-4.89 8.44-9.88 0-5.5-4.46-9.96-9.96-9.96z" />
                  </svg>
                </a>
                <a
                  href="#"
                  className="social-icon hover:dark-glow"
                  aria-label="Twitter"
                >
                  <svg
                    className="w-6 h-6 fill-current text-blue-300 dark:text-gray-400"
                    viewBox="0 0 24 24"
                  >
                    <path d="M23.95 4.57a9.97 9.97 0 0 1-2.83 1.3 4.93 4.93 0 0 0-8.38 4.5 13.98 13.98 0 0 1-10.16-5.15 4.93 4.93 0 0 0 1.52 6.58 4.9 4.9 0 0 1-2.23-0.62v0.06a4.93 4.93 0 0 0 3.95 4.84 4.9 4.9 0 0 1-2.22 0.08 4.93 4.93 0 0 0 4.6 3.42 9.87 9.87 0 0 1-6.1 2.1c-0.4 0-0.8-0.02-1.18-0.07a13.94 13.94 0 0 0 7.55 2.2c9.05 0 14-7.5 14-14v-0.64a9.96 9.96 0 0 0 2.48-2.54 9.87 9.87 0 0 1-2.8 0.77z" />
                  </svg>
                </a>
                <a
                  href="#"
                  className="social-icon hover:dark-glow"
                  aria-label="Instagram"
                >
                  <svg
                    className="w-6 h-6 fill-current text-blue-300 dark:text-gray-400"
                    viewBox="0 0 24 24"
                  >
                    <path d="M12 2.16c3.21 0 3.58 0.01 4.85 0.07 1.17 0.06 1.81 0.25 2.23 0.41 0.56 0.22 0.96 0.48 1.38 0.90 0.42 0.42 0.68 0.82 0.90 1.38 0.16 0.42 0.35 1.06 0.41 2.23 0.06 1.27 0.07 1.64 0.07 4.85s-0.01 3.58-0.07 4.85c-0.06 1.17-0.25 1.81-0.41 2.23-0.22 0.56-0.48 0.96-0.90 1.38-0.42 0.42-0.82 0.68-1.38 0.90-0.42 0.16-1.06 0.35-2.23 0.41-1.27 0.06-1.64 0.07-4.85 0.07s-3.58-0.01-4.85-0.07c-1.17-0.06-1.81-0.25-2.23-0.41-0.56-0.22-0.96-0.48-1.38-0.90-0.42-0.42-0.68-0.82-0.90-1.38-0.16-0.42-0.35-1.06-0.41-2.23-0.06-1.27-0.07-1.64-0.07-4.85s0.01-3.58 0.07-4.85c0.06 1.17 0.25-1.81 0.41-2.23 0.22-0.56 0.48-0.96 0.90-1.38 0.42-0.42 0.82-0.68 1.38-0.90 0.42-0.16 1.06-0.35 2.23-0.41 1.27-0.06 1.64-0.07 4.85-0.07zm0-2.16c-3.25 0-3.66 0.01-4.94 0.07-1.29 0.06-2.17 0.26-2.94 0.56-0.80 0.31-1.48 0.73-2.16 1.41-0.68 0.68-1.10 1.36-1.41 2.16-0.30 0.77-0.50 1.65-0.56 2.94-0.06 1.28-0.07 1.69-0.07 4.94s0.01 3.66 0.07 4.94c0.06 1.29 0.26 2.17 0.56 2.94 0.31 0.80 0.73 1.48 1.41 2.16 0.68 0.68 1.36 1.10 2.16 1.41 0.77 0.30 1.65 0.50 2.94 0.56 1.28 0.06 1.69 0.07 4.94 0.07s3.66-0.01 4.94-0.07c1.29-0.06 2.17-0.26 2.94-0.56 0.80-0.31 1.48-0.73 2.16-1.41 0.68-0.68 1.10-1.36 1.41-2.16 0.30-0.77 0.50-1.65 0.56-2.94 0.06-1.28 0.07-1.69 0.07-4.94s-0.01-3.66-0.07-4.94c-0.06-1.29-0.26-2.17-0.56-2.94-0.31-0.80-0.73-1.48-1.41-2.16-0.68-0.68-1.36-1.10-2.16-1.41-0.77-0.30-1.65-0.50-2.94-0.56-1.28-0.06-1.69-0.07-4.94-0.07zM12 5.84c-3.38 0-6.16 2.78-6.16 6.16s2.78 6.16 6.16 6.16 6.16-2.78 6.16-6.16-2.78-6.16-6.16-6.16zm0 10.16c-2.21 0-4-1.79-4-4s1.79-4 4-4 4 1.79 4 4-1.79 4-4 4zm6.4-11.2c0 0.80-0.65 1.44-1.44 1.44s-1.44-0.65-1.44-1.44 0.65-1.44 1.44-1.44 1.44 0.65 1.44 1.44z" />
